import { CHANGE_OFF, CHANGE_ON } from "./types";

export function changeOn(text) {
  return {
    type: CHANGE_ON,
    text,
  };
}

export function changeOff(text) {
  return {
    type: CHANGE_OFF,
    text,
  };
}
